
CREATE TABLE `original_category` (
	`cat_no` BIGINT(10) NOT NULL AUTO_INCREMENT COMMENT '카테고리 번호',
	`parent_cat_no` BIGINT(10) NULL DEFAULT NULL COMMENT '부모 카테고리 번호',
	`cat_nm` VARCHAR(100) NULL DEFAULT NULL COMMENT '카테고리 명',
	`vw_order` INT(11) NULL DEFAULT NULL COMMENT '노출 순서',
	`depth` INT(5) NULL DEFAULT NULL COMMENT '카테고리 깊이',
	PRIMARY KEY (`cat_no`)
)
COMMENT='카테고리 정보 simple'
COLLATE='utf8_general_ci'
ENGINE=InnoDB
AUTO_INCREMENT=43140001
;
